import React from "react";

export default function Completed(props) {
  return (
    <div className="completed">
      <input
        id={props.id}
        type="checkbox"
        className="task-done"
        defaultChecked={props.completed}
        onChange={() => props.toggleTaskCompleted(props.id)}
      />
    </div>
  );
}
